        <LineButton color = "Gold" onClick = {() =>{
            updateColor("GOLD");

        }} />

<LineButton color = "Red" onClick = {() => {
            updateColor("RED");
        }} />
         <LineButton color = "Blue" onClick = {() =>{
            updateColor("BLUE");
        }} />
         <LineButton color = "Green" onClick = {() =>{
            updateColor("GREEN");
        }} />



    </div>);





}
